function Event(props) {
    return (
        <div className='event'>
            <h2> {props.date} </h2>
            <div className='description'>
                <h3></h3>
                <hr />
                <p>A culinary event with foods from all over the world. This is a weekly club you can join for a small fee. Learn to cook something delicious and beautiful</p>
                <button>+ Event Details</button>
            </div>
            <div className='address'>
                <div className='time'>
                    <h3><span>16:00 - 19:00</span></h3>
                </div>
                <p><span>144 W Elm St, Chicago, II, 60610, USA</span></p>
            </div>
        </div>
    );
}

export default Event;
